export function nodeActiveTab(){if(!query("ul.node-tabs"))return!1;const t=attr("ul.node-tabs","id"),e=queryAll('button[data-bs-toggle="tab"]'),r=t+"-active";Array.from(e).forEach((t=>{eventActiveTab(t,r)}));const o=storeGet(r);if(o){const t=query('button[data-bs-target="'+o+'"]');new bootstrap.Tab(t).show()}}function eventActiveTab(t,e){t.addEventListener("show.bs.tab",(r=>{storeSet(e,t.dataset.bsTarget)}))}function storeSet(t,e){return localStorage.setItem(t,e)}function storeGet(t){return localStorage.getItem(t)}function query(t){return document.querySelector(t)}function queryAll(t){return document.querySelectorAll(t)}function attr(t,e){return document.querySelector(t).getAttribute(e)}